   "source": [
    "The status variable is the output variable. It is a binary integer variable, 0 corresponds to healthy and 1 corresponds to Parkinsons.\n",
    "\n",
    "The rest of the variables are predictor variables, all except 'name' are numeric types, name is character type.\n",
    "\n",
    "The 'name' feature seems useless, as it records the name of the patient along with the recording number, which doesn't seem to have any correlation with the target."
   ]
