    "for(i in 2:24) {\n",
    "    print(ggplot(df, aes(x=df[,i])) + geom_histogram(bins=30, aes(y=..density..), colour=\"black\", fill=\"white\")\n",
    "         + geom_density(alpha=.2, fill=\"#FF6666\"))\n",
    "}"
