   "source": [
    "# Prepare resampling method\n",
    "trainControl <- trainControl(method=\"repeatedcv\", number=10, repeats=3)\n",
    "metric <- \"Accuracy\"\n",
    "\n",
    "# Logistic Regression\n",
    "set.seed(7)\n",
    "fit.lr <- train(status ~ ., data=df, method=\"glm\", metric=metric, trControl=trainControl)\n",
    "# CART\n",
    "set.seed(7)\n",
    "fit.cart <- train(status ~ ., data=df, method=\"rpart\", metric=metric, trControl=trainControl)\n",
    "# # LDA\n",
    "# set.seed(7)\n",
    "# fit.lda <- train(status ~ ., data=dataset, method=\"lda\", metric=metric, trControl=trainControl)\n",
    "# Naive Bayes\n",
    "set.seed(7)\n",
    "fit.nb <- train(status ~ ., data=df, method=\"nb\", metric=metric, trControl=trainControl)\n",
    "# SVM\n",
    "set.seed(7)\n",
    "fit.svm <- train(status ~ ., data=df, method=\"svmRadial\", metric=metric, trControl=trainControl)\n",
    "# KNN\n",
    "set.seed(7)\n",
    "fit.knn <- train(status ~ ., data=df, method=\"knn\", metric=metric, trControl=trainControl)\n",
    "# Random Forest\n",
    "set.seed(7)\n",
    "fit.rf <- train(status ~ ., data=df, method=\"rf\", metric=metric, trControl=trainControl)\n",
    "\n",
    "# Collect resamples\n",
    "results <- resamples(list(LR=fit.lr, CART=fit.cart, NB=fit.nb, SVM=fit.svm, KNN=fit.knn, RF=fit.rf))\n",
    "summary(results)\n",
    "dotplot(results)"
   ]
